import React from "react";
import { StyleSheet, Text, View, ScrollView } from "react-native";
import { Ionicons } from "@expo/vector-icons";

export default function Home() {
  return (
    <View>
      <Text>Welcome</Text>
    </View>
  );
  <ScrollView scrollEventThrottle={16}>
    <View>
      <Text>Welcome</Text>
    </View>
  </ScrollView>;
}
